      adalah bisa melakukan pengulangan waktu kembali ke suatu titik waktu di masa
      lalu. Ada sebuah kelompok yang bernama “Kanrikyoku” yang mengendalikan dan mengawasi
      penggunaan kekuatan ini. Asai Kei dan Haruki Misora meerupakan anggota sebuah
      klub yang bernama “Houshi” yang menjalankan segala misi yang diberikan oleh
      Kanrikyouku. Misora memiliki kemampuan untuk mereset waktu kembali ke tiga hari
      yang lalu. Yang artinya semua kejadian dan ingatan setelah tiga hari yang lalu
      yang akan hilang. Sedangkan Kei memiliki kemampuan untuk mengingat masa lalu.
      Meski Misora menggunakan kekuatannya untuk mereset waktu, Kei tetap masih bisa
      mengingat tiga hari yang telah direset Misora. Kombinasi dari kekuatan mereka
      lah yang akan menyelesaikan berbagai misi yang diberikan oleh Kanrikyoku.  
